from operator import mul
from collections import Counter
class Solution(object):
    def numSubarrayProductLessThanK(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        n = len(nums)
        if n == 0: return 0
        if k == 0: return 0
        total = 1 if nums[0] < k else 0

        for i in range(1,n):
            pro_v = 1
            count = 0
            for j in range(i,-1,-1):
                pro_v *= nums[j]
                if pro_v < k:
                    count += 1
                else:
                    break
            total += count
        return total
    def numSubarrayProductLessThanK(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        n = len(nums)
        if n == 0: return 0
        if k == 0: return 0
        # if reduce(mul, nums) < k:
        #     return n * (n+1) /2
        counter = Counter(nums)
        counter.p()
        # if counter[1] == n:
        #     return n * (n+1) /2 
        total = 1 if nums[0] < k else 0
        pre_v = nums[0]
        pre_j = 0
        for i in range(1,n):
            if nums[i] < k:
                for j in range(pre_j, i+1):
                    if pre_v * nums[i] < k:
                        total += i - j + 1
                        break
                    else:
                        pre_v /= nums[j]
                pre_j = j
                pre_v *= nums[i]
            else:
                pre_j = i
                pre_v = nums[i]
        return total

